                                    Описание от продавца                            
Продаю четырёхкомнатную квартиру в элитном доме, в самом центре Бишкека.
пер. Токтогула/Шопокова.
Район по периметру ухожен и засажен деревьями. Свежий воздух, новая брусчатка и дорога.
Рядом:
- ГУМ- ЦУМ;- Плаза;- Плаза 2;- рынок "Ак-Эмир";
- строительный рынок Комфорт;
- строительный магазин Мегакомфорт;
- гипермаркет Фрунзе;- супермаркет Народный;
- главный корпус КРСУ;- школа "Звёздочка";
- кафе "Бублик";- ресторан "Мимино";
- пиццерия "Додо";- Халык банк и Кыргызкомерц банк;
- аптеки и многое другое.
О подъезде:
- свежий ремонт снаружи (отделан кафелем и посажены красивые цветы и деревья);
- чиповая металлическая дверь с домофоном;
- свежий ремонт внутри (первый этаж отделан кафелем, остальные этажи окрашены в светло-оранжевый цвет);
- новый большой лифт;
- две квартиры на этаже.
О квартире:
- пятый этаж (10 этажный дом);
- общая квадратура 185 кв.м.;- жилая квадратура 170 кв.м.;- высота потолков 3,05 м.;
- 3 спальные комнаты - каждая 20-22 кв.м.
- огромный зал - 47 кв.м.;- большая кухня - 24 кв.м.;
- 2 прихожие - 16 кв.м.;
- 3 санузла - каждый 8 кв.м.;- два балкона - 15 кв.м.
- парковочное место напротив подъезда;
- подсобка на 1 этаже подъезда (единственная в доме);- евроремонт;
- кондиционеры, телевидение, Wi-fi в каждой комнате.
Цена 185000$
Тел +996709323185,+996554090592

